import { render } from 'react-dom';
import './index.css';
import * as React from 'react';
import { TimePickerComponent } from '@syncfusion/ej2-react-calendars';
import { SampleBase } from './sample-base';

export class Format extends SampleBase {
    constructor() {
        super(...arguments);
        this.value = new Date();
        this.interval = 60;
        this.customFormat = 'HH:mm';
    }
    render() {
        return (<div className='control-pane format'>
                <div className='control-section'>
                    <div className='timepicker-control-section'>
                        <TimePickerComponent value={this.value} step={this.interval} format={this.customFormat}></TimePickerComponent>
                    </div>
                </div>
            </div>);
    }
}

render(<Format />, document.getElementById('sample'));

